import { Link } from "react-router-dom";
import { useAuth } from "../auth/AuthContext";

export default function Sidebar() {
  // ✅ Added logout to the destructuring
  const { profile, logout } = useAuth();

  const roleName =
    profile?.roles?.name || profile?.role || profile?.user_roles?.role || null;

  const isAdmin = roleName === "ADMIN";
  const isResident = roleName === "RESIDENT";
  const isWorker = roleName === "WORKER";
  const isSecurity = roleName === "SECURITY";

  return (
    <div
      style={{
        width: 220,
        background: "#fff",
        padding: 12,
        borderRight: "1px solid #eee",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        gap: 8,
      }}
    >
      <p><Link to="/dashboard">Dashboard</Link></p>

      {/* RESIDENT Links */}
      {isResident && (
        <>
          <p><Link to="/complaints">Complaints</Link></p>
          <p><Link to="/worker-services">Worker Services</Link></p>
          <p><Link to="/notices">Notices</Link></p>
          <p><Link to="/events">Events</Link></p>
          <p><Link to="/facilities">Facilities</Link></p>
          <p><Link to="/maintenance">Maintenance</Link></p>
          <p><Link to="/my-parcels">My Visitors & Parcels</Link></p>
          <p><Link to="/marketplace">Marketplace</Link></p>
        </>
      )}

      {/* WORKER Links */}
      {isWorker && (
        <>
          <p><Link to="/complaints">Complaints</Link></p>
          <p><Link to="/worker-services">Worker Services</Link></p>
          <p><Link to="/marketplace">Marketplace</Link></p>
        </>
      )}

      {/* SECURITY Links */}
      {isSecurity && (
        <>
          <p><Link to="/gate">Gate Management</Link></p>
          <p><Link to="/marketplace">Marketplace</Link></p>
        </>
      )}

      {/* ADMIN Links */}
      {isAdmin && (
        <>
          <p><Link to="/complaints">Complaints</Link></p>
          <p><Link to="/worker-services">Worker Services</Link></p>
          <p><Link to="/notices">Notices</Link></p>
          <p><Link to="/events">Events</Link></p>
          <p><Link to="/facilities">Facilities</Link></p>
          <p><Link to="/maintenance">Maintenance</Link></p>
          <p><Link to="/gate">Gate Management</Link></p>
          <p><Link to="/marketplace">Marketplace</Link></p>
          {/* ✅ New Admin-only link for Seller Approval */}
          <p><Link to="/marketplace/sellers" style={{ color: "#007bff", fontWeight: "bold" }}>Approve Sellers</Link></p>
        </>
      )}

      {/* Footer */}
      <div style={{ marginTop: "auto", borderTop: "1px solid #eee", paddingTop: 12 }}>
        <div style={{ fontSize: 12, color: "#888", marginBottom: 8 }}>
          Role: <strong>{roleName || "User"}</strong>
        </div>

        {/* ✅ Finalized Logout Button */}
        <button 
          onClick={logout} 
          style={{ 
            width: "100%",
            padding: "8px",
            background: "#ff4d4f",
            color: "white",
            border: "none",
            borderRadius: "4px",
            cursor: "pointer",
            fontWeight: "bold"
          }}
        >
          Logout
        </button>
      </div>
    </div>
  );
}
